import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { useTheme } from "../contexts/ThemeContext";
import "../styles/Navbar.css";

const Navbar = () => {
  const [isScrolled, setIsScrolled] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [isThemeReady, setIsThemeReady] = useState(false);

  // Use the theme context
  const { theme, toggleTheme } = useTheme();

  useEffect(() => {
    const handleScroll = () => {
      setIsScrolled(window.scrollY > 50);
    };

    window.addEventListener("scroll", handleScroll);
    return () => window.removeEventListener("scroll", handleScroll);
  }, []);

  useEffect(() => {
    // Mark theme as ready once it's available
    if (theme) {
      setIsThemeReady(true);
    }
  }, [theme]);

  const toggleMenu = () => {
    setIsMenuOpen(!isMenuOpen);
  };

  // Determine theme label
  const themeLabel = isThemeReady && theme === "light" 
    ? "Switch to dark mode" 
    : "Switch to light mode";

  // Default theme icon when theme is not ready
  if (!isThemeReady) {
    return (
      <nav className={isScrolled ? "navbar scrolled" : "navbar"}>
        <div className="nav-container">
          <Link to="/" className="nav-logo">
            HM
          </Link>

          <div className={isMenuOpen ? "nav-menu active" : "nav-menu"}>
            <Link to="/" className="nav-link" onClick={() => setIsMenuOpen(false)}>
              Home
            </Link>
            <Link to="/projects" className="nav-link" onClick={() => setIsMenuOpen(false)}>
              Projects
            </Link>
            <Link to="/contact" className="nav-link" onClick={() => setIsMenuOpen(false)}>
              Contact
            </Link>
          </div>

          <div className="nav-actions">
            <button 
              className="theme-toggle" 
              onClick={toggleTheme}
              aria-label="Loading theme..."
            >
              <i className="fas fa-spinner fa-spin"></i>
            </button>
          </div>

          <div className={isMenuOpen ? "nav-toggle active" : "nav-toggle"} onClick={toggleMenu}>
            <span className="bar"></span>
            <span className="bar"></span>
            <span className="bar"></span>
          </div>
        </div>
      </nav>
    );
  }

  return (
    <nav className={isScrolled ? "navbar scrolled" : "navbar"}>
      <div className="nav-container">
        <Link to="/" className="nav-logo">
          HM
        </Link>

        <div className={isMenuOpen ? "nav-menu active" : "nav-menu"}>
          <Link to="/" className="nav-link" onClick={() => setIsMenuOpen(false)}>
            Home
          </Link>
          <Link to="/projects" className="nav-link" onClick={() => setIsMenuOpen(false)}>
            Projects
          </Link>
          <Link to="/contact" className="nav-link" onClick={() => setIsMenuOpen(false)}>
            Contact
          </Link>
        </div>

        <div className="nav-actions">
          <button 
            className="theme-toggle" 
            onClick={toggleTheme}
            aria-label={themeLabel}
          >
            {theme === "light" ? (
              <i className="fas fa-moon"></i>
            ) : (
              <i className="fas fa-sun"></i>
            )}
          </button>
        </div>

        <div className={isMenuOpen ? "nav-toggle active" : "nav-toggle"} onClick={toggleMenu}>
          <span className="bar"></span>
          <span className="bar"></span>
          <span className="bar"></span>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
